import { useNavigate } from 'react-router-dom';
import homeImage from '../../assets/images/home/homeFemale.jpg'
const Home = () => {
  const navigate = useNavigate();
  const handleClick = () => {
    navigate("/login");
  };
    return (
      <div className="onboarding-container">
        <img src={homeImage} alt="home" className="home-Image" /> 
        <div className="about-section">
          <p className= "name">RetroCraft Hub</p>
          <p className="about">
          A dynamic digital space dedicated to inclusive education, skill development, and peer networking. We're here to break down barriers and provide students a peer community and connections they need to thrive in their academic and professional journeys.        </p>
          <button type="button" className='btn-home' onClick={handleClick}>Primary</button>
        </div>
      </div>
    );
  };

  export default Home;
